import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import SiteLayout from './SiteLayout';
import { contentService } from '../../services/contentService';
import './SitePage.css';

// –°—Ç–∞—Ç–∏—á–Ω—ñ –∫–æ–º–ø–æ–Ω–µ–Ω—Ç–∏
import Home from '../static/Home';
import About from '../static/About';
import Departments from '../static/Departments';
import Contacts from '../static/Contacts';
import NewsList from '../news/NewsList';
import NewsItem from '../news/NewsItem';
import GalleryPage from './gallery/GalleryPage';

// üü¶ –ö–æ–º–ø–æ–Ω–µ–Ω—Ç –ø—Ä–æ–∑–æ—Ä–æ—Å—Ç—ñ
import TransparencySection from './TransparencySection';

const SitePage = () => {
  const { pageName } = useParams();
  const [content, setContent] = useState('');
  const [loading, setLoading] = useState(false);

  // –î–∏–Ω–∞–º—ñ—á–Ω—ñ —Å—Ç–æ—Ä—ñ–Ω–∫–∏, —è–∫—ñ –±–µ—Ä—É—Ç—å –∫–æ–Ω—Ç–µ–Ω—Ç –∑ –±–∞–∑–∏ "content"
  const dynamicPages = ['about', 'contacts', 'departments', 'home'];

  useEffect(() => {
    // –ó–∞–≤–∞–Ω—Ç–∞–∂—É—î–º–æ –∫–æ–Ω—Ç–µ–Ω—Ç –ª–∏—à–µ –¥–ª—è —Å—Ç–æ—Ä—ñ–Ω–æ–∫, —è–∫—ñ —î —É dynamicPages
    if (dynamicPages.includes(pageName)) {
      loadContent();
    }
  }, [pageName]);

  const loadContent = async () => {
    setLoading(true);
    try {
      const response = await contentService.getContent(pageName);
      setContent(response.data.content || '');
    } catch (error) {
      console.error('‚ùå –ü–æ–º–∏–ª–∫–∞ –∑–∞–≤–∞–Ω—Ç–∞–∂–µ–Ω–Ω—è –∫–æ–Ω—Ç–µ–Ω—Ç—É:', error);
      setContent('<p>–ö–æ–Ω—Ç–µ–Ω—Ç –Ω–µ –∑–Ω–∞–π–¥–µ–Ω–æ</p>');
    } finally {
      setLoading(false);
    }
  };

  // –†–µ–Ω–¥–µ—Ä–∏–Ω–≥ —Å—Ç–æ—Ä—ñ–Ω–æ–∫
  const renderContent = () => {
    switch (pageName) {
      case 'home':
        return loading
          ? <div style={{ padding: '2rem', textAlign: 'center' }}>–ó–∞–≤–∞–Ω—Ç–∞–∂–µ–Ω–Ω—è...</div>
          : <div dangerouslySetInnerHTML={{ __html: content || '<p>–ì–æ–ª–æ–≤–Ω–∞ —Å—Ç–æ—Ä—ñ–Ω–∫–∞</p>' }} />;

      case 'about':
        return loading
          ? <div style={{ padding: '2rem', textAlign: 'center' }}>–ó–∞–≤–∞–Ω—Ç–∞–∂–µ–Ω–Ω—è...</div>
          : <div dangerouslySetInnerHTML={{ __html: content || '<p>–Ü–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—è –ø—Ä–æ —à–∫–æ–ª—É</p>' }} />;

      case 'departments':
        return loading
          ? <div style={{ padding: '2rem', textAlign: 'center' }}>–ó–∞–≤–∞–Ω—Ç–∞–∂–µ–Ω–Ω—è...</div>
          : <div dangerouslySetInnerHTML={{ __html: content || '<p>–†–æ–∑–¥—ñ–ª–∏ —à–∫–æ–ª–∏</p>' }} />;

      case 'contacts':
        return loading
          ? <div style={{ padding: '2rem', textAlign: 'center' }}>–ó–∞–≤–∞–Ω—Ç–∞–∂–µ–Ω–Ω—è...</div>
          : <div dangerouslySetInnerHTML={{ __html: content || '<p>–ö–æ–Ω—Ç–∞–∫—Ç–Ω–∞ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—è</p>' }} />;

      case 'news':
        return <NewsList />;

      case 'gallery':
        return <GalleryPage />;

      case 'transparency':
        // üü© –ü—Ä–æ–∑–æ—Ä—ñ—Å—Ç—å –±–µ—Ä–µ –¥–∞–Ω—ñ –∑ –æ–∫—Ä–µ–º–æ—ó —Ç–∞–±–ª–∏—Ü—ñ transparency
        return <TransparencySection />;

      default:
        return (
          <div style={{ padding: '2rem', textAlign: 'center' }}>
            <h1>–°—Ç–æ—Ä—ñ–Ω–∫—É –Ω–µ –∑–Ω–∞–π–¥–µ–Ω–æ</h1>
            <p>–°—Ç–æ—Ä—ñ–Ω–∫–∞ "{pageName}" –Ω–µ —ñ—Å–Ω—É—î.</p>
            <a href="/site/home">–ü–æ–≤–µ—Ä–Ω—É—Ç–∏—Å—è –Ω–∞ –≥–æ–ª–æ–≤–Ω—É</a>
          </div>
        );
    }
  };

  return (
    <SiteLayout>
      {renderContent()}
    </SiteLayout>
  );
};

// –û–∫—Ä–µ–º–∏–π –∫–æ–º–ø–æ–Ω–µ–Ω—Ç –¥–ª—è —Å—Ç–æ—Ä—ñ–Ω–∫–∏ –Ω–æ–≤–∏–Ω–∏
export const NewsPage = () => {
  const { id } = useParams();

  if (id) {
    return (
      <SiteLayout>
        <NewsItem />
      </SiteLayout>
    );
  }

  return (
    <SiteLayout>
      <NewsList />
    </SiteLayout>
  );
};

export default SitePage;
